Hey DJ, you need tools to take decisions for your DJ sets?
You want to raise your skill at a next level but you have no time or no devices to prepare your DJ set for tonight!

Check this out :

Music analyzer is the best tool for you. Nowadays, Pro DJs use some datas to build their mix efficiently. Bpm, harmonic keys and decibels are now crucial to answer the question : which track is the best to play after that other track to set an exceptional mix?

There are no secrets, just tools!

Music analyzer was created to guarantee that your DJ sets will sound perfectly. Mixing harmonically enables you to create smooth transitions between songs and ensure that your vocals, melodies and basslines sound great together. It will analyze the harmonic keys, bpm and decibels of your music in order to help you choosing the tracks that are compatible.

With music analyzer, all is pretty simple.

You use DJ Spirits  to analyze a track and extract all the precious information you need.

At first, you've got 10 DJ Spirits to import your tracks or playlist. Each 24 hours, if your account is empty, we will refill your account with 5 new DJ Spirits for free cause we want to help you to get the best choices.
But don't forget, anytime you want more DJ Spirits, you can tap on the DJ Spirits badge and get some more.

With music analyzer, you can import tracks from your iTunes library and scan live music too. And as great results need great tools, in music analyzer we've incorporated an advanced player connected to your current list in order to play your tracks and remote them from any accessories : headset, car, etc.

Features in Music Analyzer :

- Scan from iTunes;
- Scan live;
- Change the rating for your iTunes tracks and automatically save them during the synchronization;
- History and tracklisting builder;
- Sort by bpm, harmonic keys, decibels;
- Choose among tracks proposed according to their harmonic keys;
- Share your current tracklist by email;
- Get precious data like bpm, harmonic keys, decibels, first beat estimation to set a cue in an easier way;
- Tap bpm;
- Use the advanced player : play, pause, tempo, track details, rewind, forward, etc.;
- Remote your player with any accessories : car, headset, iPhone default button, etc.

And by the way, it is FREE!
